import React from "react";
import moviesData from '../moviesData'

class App extends React.Component {
  constructor() {

    state = {
      movies: moviesData
    }
  }
  render() {
    return (
      <div className="moviesAll">
        {this.state.movies.map (function(movie){
          return <p>{movie.title}</p>
        })}
      </div>
    )
  }
}

export default App;
